import React, { Component } from "react";
import Marquee from "./listenComponents/Marquee";

export default class Listen extends Component {
  render() {
    const visible = {
      marginTop: "200px"
    };
    return (
      <div className="audio-container" title="title" style={visible}>
        <h1 title="title">{this.props.title}</h1>
        <Marquee
          mp3artist="Lea Hughes"
          mp3genre="ambient"
          title="title"
        ></Marquee>
      </div>
    );
  }
}
